export const fetchJobs = async (page = 0, limit = 10) => {
    const endIndex = page * limit
    return fetch(`http://localhost:9000/jobs?page=${page}&limit=${limit}`
        , {
            headers: {
                'Content-Type': 'application/json',
                'Accept': 'application/json'
            }
        }
    )
        .then(function (response) {
            console.log(response)
            return response.json();
        })
        .then(function (result) {
            console.log(result.slice(page, limit));
            return result.slice(page, limit)
        });
}
